INSERT INTO public."Clinics" (name,"provinceId","provinceName",address,image,"descriptionHTML","descriptionMarkdown","createdAt","updatedAt") VALUES
	 ('Bệnh viện Hữu nghị Việt Đức','PRO1','Hà Nội','Số 16-18 Phủ Doãn - Hoàn Kiếm - Hà Nội',decode('','hex'),'<h2>GIỚI THIỆU</h2><p><strong>Địa chỉ:</strong>  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng:</p><ul><li>Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội</li></ul><p><strong>Thời gian làm việc:</strong> Thứ 2 đến thứ 7</p><p>Sáng: 7h00 - 12h00Chiều: 13h30 - 16h30Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước.</p><p>Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân.</p><p>Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau.</p><p><strong>Lưu ý quan trọng</strong></p><ul><li>Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.</li><li>Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.</li><li>Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.</li></ul>','## GIỚI THIỆU**Địa chỉ:**  Bệnh viện có nhiều cổng, bệnh nhân đến khám sẽ đến cổng: * Số 16 - 18 Phủ Doãn, Hoàn Kiếm, Hà Nội**Thời gian làm việc:** Thứ 2 đến thứ 7Sáng: 7h00 - 12h00Chiều: 13h30 - 16h30Bệnh viện Việt Đức là một trong 5 bệnh viện tuyến Trung ương, hạng đặc biệt của Việt Nam. Bệnh viện có lịch sử trên 100 năm, bề dày truyền thống danh tiếng, là cái nôi của ngành ngoại khoa Việt Nam gắn liền với những thành tựu Y học quan trọng của đất nước. Việt Đức là địa chỉ uy tín hàng đầu về ngoại khoa, tiến hành khám bệnh, chữa bệnh và thực hiện các kỹ thuật chụp chiếu, xét nghiệm, thăm dò chức năng cơ bản và chuyên sâu hàng ngày cho người dân. Bệnh viện có đội ngũ y bác sĩ hùng hậu, nhiều người kiêm là cán bộ giảng dạy tại Đại học Y khoa Hà Nội hoặc Khoa Y Dược - Đại học Quốc gia Hà Nội. Trong số họ nhiều người là chuyên gia đầu ngành và bác sĩ giàu kinh nghiệm ở các chuyên khoa khác nhau. **Lưu ý quan trọng*** Bệnh viện có nhiều khu khám bệnh, do đó để thuận tiện và tiết kiệm thời gian khi đi khám, người bệnh nên tìm hiểu kĩ về vị trí khu khám bệnh của mình trước khi đi khám.* Bệnh viện Hữu nghị Việt Đức là bệnh viện chuyên về Ngoại khoa, vì vậy, lịch các bác sĩ thường linh động và ưu tiên khám cho các ca cấp cứu.* Người bệnh nên chủ động chuẩn bị một số câu hỏi liên quan đến tình trạng của mình trước khi đi khám để hành trình khám bệnh được hiệu quả hơn.','2023-01-25 11:49:59+07','2023-01-25 11:49:59+07'),
	 ('Bệnh viện Chợ Rẫy','PRO2','Hồ Chí Minh','201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh',decode('','hex'),'<h2>GIỚI THIỆU</h2><p>Bệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.</p><p>Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.</p><p><strong>Địa chỉ bệnh viện:</strong></p><p>201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh</p><p><strong>Thời gian làm việc:</strong></p><p>Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:</p><ul><li>Thứ 2 đến thứ 6: từ 7h – 16h</li><li>Thứ 7: từ 7h – 11h</li></ul>','## GIỚI THIỆUBệnh viện Chợ Rẫy với lịch sử thành lập trên 100 năm, là bệnh viện hạng đặc biệt tuyến Trung ương lớn nhất cả nước với trên 1.800 giường và trên 3.000 kỹ thuật y tế được thực hiện. Hàng ngày Bệnh viện Chợ Rẫy tiếp nhận trung bình 6,000 -  8,000 bệnh nhân đến khám.Bệnh viện Chợ Rẫy là bệnh viện đa khoa hoàn chỉnh, xếp hạng đặc biệt, tuyến kỹ thuật sau cùng các tỉnh thành phía Nam, trực thuộc Bộ Y tế. Thế mạnh nổi bật tại Bệnh viện Chợ Rẫy là sự kết hợp giữa các chuyên khoa mang lại hiệu quả tốt nhất trong việc chẩn đoán và điều trị cho người bệnh.**Địa chỉ bệnh viện:**201B Nguyễn Chí Thanh, Phường 12, Quận 5, Hồ Chí Minh**Thời gian làm việc:**Bệnh viện làm việc, tiếp nhận khám bệnh cho bệnh nhân ngoại trú từ thứ 2 đến thứ 7 hàng tuần:* Thứ 2 đến thứ 6: từ 7h – 16h* Thứ 7: từ 7h – 11h','2023-01-25 11:54:19+07','2023-01-25 11:54:19+07'),
	 ('Phòng khám Bệnh viện Đại học Y Dược 1','PRO2','Hồ Chí Minh','20-22 Dương Quang Trung, Phường 12, Quận 10, Tp. HCM',decode('','hex'),'<p>Từ nay, người bệnh có thể đặt khámPhòng khám Bệnh viện Đại học Y Dược 1 thông qua hệ thống đặt khám BookingCare.</p><p>Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệmHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)Giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khámNhận được hướng dẫn đi khám chi tiết sau khi đặt lịch</p>','Từ nay, người bệnh có thể đặt khámPhòng khám Bệnh viện Đại học Y Dược 1 thông qua hệ thống đặt khám BookingCare.Được lựa chọn khám với các bác sĩ chuyên khoa giàu kinh nghiệmHỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)Giảm thiểu thời gian chờ đợi xếp hàng làm thủ tục khámNhận được hướng dẫn đi khám chi tiết sau khi đặt lịch','2023-01-25 11:57:44+07','2023-01-25 11:57:44+07'),
	 ('Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108','PRO1','Hà Nội',' Số 1 Trần Hưng Đạo, Hai Bà Trưng, Hà Nội',decode('','hex'),'<p>Từ nay, người bệnh có thể đặt lịch tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108 thông qua hệ thống đặt khám BookingCare:</p><ul><li>Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)</li><li>Lựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu</li><li>Giảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước</li><li>Hỗ trợ thực hiện chụp chiếu, xét nghiệm, cận lâm sàng</li></ul>','Từ nay, người bệnh có thể đặt lịch tại Trung tâm Khám sức khỏe định kỳ, Bệnh viện Trung ương Quân đội 108 thông qua hệ thống đặt khám BookingCare:* Hỗ trợ đặt khám trực tuyến trước khi đi khám (miễn phí đặt lịch)* Lựa chọn gói khám từ cơ bản đến chuyên sâu theo nhu cầu* Giảm thời gian chờ đợi: Không phải xếp hàng làm thủ tục khám và ưu tiên khám trước* Hỗ trợ thực hiện chụp chiếu, xét nghiệm, cận lâm sàng','2023-01-26 16:59:14+07','2023-01-26 16:59:14+07'),
	 ('Bệnh viện K - Cơ sở Phan Chu Trinh','PRO1','Hà Nội','9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội',decode('','hex'),'<h2>GIỚI THIỆU</h2><p>Địa chỉ: 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà Nội</p><p>Thời gian làm việc: Thứ 2 đến thứ 7 (6h00 - 17h00)</p><p>Bệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:</p><ul><li>Cấp cứu, khám bệnh, chữa bệnh, phòng bệnh</li><li>Phục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.</li><li>Đào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.</li><li>Nghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.</li></ul>','## GIỚI THIỆUĐịa chỉ: 9A - 9B Phan Chu Trinh, Hoàn Kiếm, Hà NộiThời gian làm việc: Thứ 2 đến thứ 7 (6h00 - 17h00)Bệnh viện K được biết đến là cơ sở chuyên khoa đầu ngành về khám, điều trị và phòng chống ung thư của cả nước. Bệnh viện K Phan Chu Trinh là một trong ba cơ sở của Bệnh viện K Trung ương với chức năng, nhiệm vụ chính là:* Cấp cứu, khám bệnh, chữa bệnh, phòng bệnh* Phục hồi chức năng chuyên khoa ung bướu và các bệnh trong khả năng của bệnh viện cho người bệnh trong nước, nước ngoài.* Đào tạo và tham gia đào tạo cán bộ y tế, làm công tác chỉ đạo tuyến, tham gia phòng chống dịch bệnh theo nhiệm vụ được Bộ Y tế phân công.* Nghiên cứu khoa học, triển khai ứng dụng khoa học, công nghệ, kỹ thuật hiện đại để phục vụ người bệnh và phục vụ công tác nghiên cứu khoa học và đào tạo nhân lực y tế.','2023-01-26 17:02:21+07','2023-01-26 17:02:21+07'),
	 ('Bệnh viện Bạch Mai','PRO1','Hà Nội',' 78 Đường Giải Phóng, Phương Mai, Đống Đa, Hà Nội',decode('','hex'),'<p>Bệnh viện Bạch Mai là một trong những bệnh viện lớn nhất của Việt Nam có địa chỉ tại Hà Nội.</p><p>Hiện nay, đây là cơ sở y tế uy tín, chất lượng được nhiều người bệnh trên địa bàn thành phố và các tỉnh thành lân cận tin tưởng đến thăm khám và điều trị.</p>','Bệnh viện Bạch Mai là một trong những bệnh viện lớn nhất của Việt Nam có địa chỉ tại Hà Nội. Hiện nay, đây là cơ sở y tế uy tín, chất lượng được nhiều người bệnh trên địa bàn thành phố và các tỉnh thành lân cận tin tưởng đến thăm khám và điều trị.','2023-01-28 14:14:11+07','2023-01-28 14:14:11+07'),
	 ('Bệnh Viện Tai Mũi Họng Trung Ương','PRO1','Hà Nội','78 Giải Phóng, Phương Đình, Đống Đa, Hà Nội',decode('','hex'),'<p>Bệnh viện Tai Mũi Họng Trung ương là bệnh viện công lập chuyên khoa hàng đầu về điều trị bệnh tai mũi họng, đặt tại Hà Nội, Việt Nam Bệnh viện có tên dịch ra tiếng Anh là National</p>','Bệnh viện Tai Mũi Họng Trung ương là bệnh viện công lập chuyên khoa hàng đầu về điều trị bệnh tai mũi họng, đặt tại Hà Nội, Việt Nam Bệnh viện có tên dịch ra tiếng Anh là National','2023-01-28 14:17:48+07','2023-01-28 14:17:48+07'),
	 ('Bệnh viện Tâm thần TPHCM','PRO2','Hồ Chí Minh','Cơ sở 1: 766 Võ Văn Kiệt, Phường 1, Quận 5, TPHCM',decode('','hex'),'<p>Bệnh viện Tâm thần TPHCM là bệnh viện tuyến thành phố, chuyên sâu điều trị các rối loạn tâm lý, tâm thần với đội ngũ bác sĩ, chuyên gia giàu kinh nghiệm.</p>','Bệnh viện Tâm thần TPHCM là bệnh viện tuyến thành phố, chuyên sâu điều trị các rối loạn tâm lý, tâm thần với đội ngũ bác sĩ, chuyên gia giàu kinh nghiệm.','2023-01-28 14:25:27+07','2023-01-28 14:25:27+07'),
	 ('Bệnh viện Da liễu Trung ương','PRO1','Hà Nội','15A, Phương Mai, Hà Nội',decode('','hex'),'<p>Bệnh viện Da liễu Trung ương là bệnh viện công lập chuyên khoa đầu ngành về chuyên ngành da liễu, đặt tại Hà Nội, Việt Nam. Bệnh viện có tên dịch ra tiếng Anh là National Hospital of Dermatology and Venereology, viết tắt là NHDV</p>','Bệnh viện Da liễu Trung ương là bệnh viện công lập chuyên khoa đầu ngành về chuyên ngành da liễu, đặt tại Hà Nội, Việt Nam. Bệnh viện có tên dịch ra tiếng Anh là National Hospital of Dermatology and Venereology, viết tắt là NHDV','2023-01-28 14:36:35+07','2023-01-28 14:36:35+07');
